--
-- Name: addtocart(integer, integer, integer); Type: PROCEDURE; Schema: public; Owner: annasuslova
--

CREATE PROCEDURE public.addtocart(IN p_customer_id integer, IN p_product_id integer, IN p_quantity integer)
    LANGUAGE plpgsql
    AS $$
DECLARE 
    new_order_id INT;
    customer_shipping_address VARCHAR(255);
    product_stock INT;
BEGIN
    SELECT order_id INTO new_order_id
    FROM "Orders"
    WHERE customer_id = p_customer_id AND status_id = 3;
    
    SELECT quantity INTO product_stock
    FROM "Stock_Items"
    WHERE product_id = p_product_id;

    IF new_order_id IS NULL THEN
        VALUES (p_customer_id, current_date, 0, NULL, 3)
        RETURNING order_id INTO new_order_id;
    END IF;

    IF product_stock >= p_quantity THEN
        VALUES (new_order_id, p_product_id, p_quantity);

        UPDATE "Orders"
        SET total_sum = (
            SELECT COALESCE(SUM(oi.quantity * pr.price), 0)
            FROM "Order_Items" oi
            JOIN "Products" pr ON oi.product_id = pr.product_id
            WHERE oi.order_id = new_order_id
        )
        WHERE order_id = new_order_id;
        
        UPDATE "Stock_Items"
        SET quantity = product_stock - p_quantity
        WHERE product_id = p_product_id;
    END IF;
END;
$$;


ALTER PROCEDURE public.addtocart(IN p_customer_id integer, IN p_product_id integer, IN p_quantity integer) OWNER TO annasuslova;

--
-- Name: get_customer_order_history(integer); Type: FUNCTION; Schema: public; Owner: annasuslova
--

CREATE FUNCTION public.get_customer_order_history(input_customer_id integer) RETURNS TABLE(order_id integer, products_ordered text, total_sum numeric, order_date timestamp without time zone, status character varying)
    LANGUAGE plpgsql
    AS $$
BEGIN
    RETURN QUERY
    SELECT 
        o.order_id,
        STRING_AGG(p.name || ' (' || oi.quantity || ' items)', ', ') AS products_ordered,
        o.total_sum,
        o.order_date,
        os.name
    FROM
        "Orders" o
        JOIN "Order_Items" oi ON o.order_id = oi.order_id
        JOIN "Products" p ON oi.product_id = p.product_id
        LEFT JOIN "Payment_Transactions" pt ON o.order_id = pt.order_id
        LEFT JOIN "Shipping_Information" si ON o.order_id = si.order_id
		LEFT JOIN "Order_Statuses" os ON o.status_id = os.status_id
    WHERE
        o.customer_id = input_customer_id
    GROUP BY
        o.order_id, o.order_date, os.name, o.total_sum;

END;
$$;


ALTER FUNCTION public.get_customer_order_history(input_customer_id integer) OWNER TO annasuslova;

--
-- Name: get_revenue_by_category(character varying); Type: FUNCTION; Schema: public; Owner: annasuslova
--

CREATE FUNCTION public.get_revenue_by_category(category character varying) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE 
    category_revenue DECIMAL(10,2);
BEGIN
    SELECT SUM(OI.quantity * P.price) INTO category_revenue
    FROM "Orders" AS O
    JOIN "Order_Items" AS OI ON O.order_id = OI.order_id
    JOIN "Products" AS P ON OI.product_id = P.product_id
    JOIN "Product_Categories" AS PC ON P.category_id = PC.category_id
    WHERE PC.name = category;
    
    RETURN category_revenue;
END;
$$;


ALTER FUNCTION public.get_revenue_by_category(category character varying) OWNER TO annasuslova;

--
-- Name: get_top_selling_product(date, date); Type: FUNCTION; Schema: public; Owner: annasuslova
--

CREATE FUNCTION public.get_top_selling_product(p_start_date date, p_end_date date) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE 
    top_product VARCHAR(255);
BEGIN
    SELECT p.name INTO top_product
    FROM "Products" p
    JOIN "Order_Items" oi ON p.product_id = oi.product_id
    JOIN "Orders" o ON oi.order_id = o.order_id
    WHERE o.order_date BETWEEN p_start_date AND p_end_date
    GROUP BY p.product_id, p.name
    ORDER BY SUM(oi.quantity) DESC
    LIMIT 1; 
    
    RETURN top_product;
END;
$$;


